IF EXISTS(SELECT TOP 1 1 FROM tblTFTaxAuthority WHERE strTaxAuthorityCode = 'MN' AND ysnFilingForThisTA = 1)
BEGIN
	PRINT ('Deploying Minnesota Tax Forms')
END
GO

